/****************************************************************************//**
 * @brief  DAC clock init
 *
 * @param  None
 *
 * @return None
 *
*******************************************************************************/
static void DAC_Clock_Init(void)
{
    GLB_Set_DAC_CLK(ENABLE,GLB_DAC_CLK_32M,0x40);
}

/****************************************************************************//**
 * @brief  DAC gpio init
 *
 * @param  None
 *
 * @return None
 *
*******************************************************************************/
static void DAC_Gpio_Init(void)
{
    GLB_GPIO_Init(&gpioCfg[0]);
}

/****************************************************************************//**
 * @brief  LLI Init
 *
 * @param  None
 *
 * @return None
 *
*******************************************************************************/
static void DAC_LLI_Init(void)
{
    uint32_t i = 0;
    for(i = 0; i < 20; i++) {
        LLIList[i].srcDmaAddr = (uint32_t)dac_audio_buf + i * 2000;
        LLIList[i].destDmaAddr = 0x40002048;
        LLIList[i].nextLLI=0;
        if(i!=0){
            LLIList[i-1].nextLLI=(uint32_t)&LLIList[i];
        }
        if(i==20-1){
            //dmaCtrlRegVal.I=1;
            dmaCtrlRegVal.I=0;
        }else{
            dmaCtrlRegVal.I=0;
        }
        LLIList[i].dmaCtrl= dmaCtrlRegVal;
    }
    
    LLIList[19].nextLLI=(uint32_t)&LLIList[0];


    DMA_LLI_Init(DAC_DMA_CHANNLE,&lliCfg);//set llicfg config  into reg
    DMA_LLI_Update(DAC_DMA_CHANNLE, (uint32_t)&LLIList);//first time .fill src address to reg
}

/****************************************************************************//**
 * @brief  GPIP DAC reg output test
 *
 * @param  None
 *
 * @return SUCCESS or ERROR
 *
*******************************************************************************/
static BL_Err_Type DAC_DMA_Test(void)
{
    //MSG("\r\nDAC basic fuction by dma test case\r\n");


    DAC_Gpio_Init();
    DAC_Clock_Init();

    GLB_GPIP_DAC_Set_ChanA_Config(&chACfg);
    GLB_GPIP_DAC_Set_ChanB_Config(&chBCfg);

    DMA_Enable();
    DMA_Channel_Disable(DAC_DMA_CHANNLE);
    DAC_LLI_Init();

    DMA_Channel_Enable(DAC_DMA_CHANNLE);

    GLB_GPIP_DAC_Init(&dacCfg);
    GPIP_Set_DAC_DMA_TX_FORMAT_SEL(GPIP_DAC_DMA_FORMAT_0);
    GPIP_Set_DAC_DMA_TX_Enable();

    return SUCCESS;
}


